C# MongoDB query: filter based on the last item of array<p>I have a MongoDB collection like this:</p>
<pre><code>{
    _id: &quot;abc&quot;,
    history: 
    [
        {
            status: 1,
            reason: &quot;confirmed&quot;
        },
        {
            status: 2,
            reason: &quot;accepted&quot;
        }
    ],
    _id: &quot;xyz&quot;,
    history: 
    [
        {
            status: 2,
            reason: &quot;accepted&quot;
        },
        {
            status: 10,
            reason: &quot;cancelled&quot;
        }
    ]
}
</code></pre>
<p>I want to write a query in C# to return the documents whose <strong>last</strong> history item is 2 (accepted). So in my result I should not see &quot;xyz&quot; because its state has changed from 2, but I should see &quot;abc&quot; since its last status is 2. The problem is that getting the <strong>last item</strong> is not easy with MongoDB's C# driver - or I don't know how to.</p>
<p>I tried the linq's lastOrDefault but got <code>System.InvalidOperationException: {document}{History}.LastOrDefault().Status is not supported</code> error.</p>
<p>I know there is a workaround to get the documents first (load to memory) and then filter, but it is client side and slow (consumes lot of network). I want to do the filter on server.</p>

