MongoDB: How to insert a singleton array with a value in every nested field?<p>Consider a collection consisting of documents of the following shape:</p>
<pre><code>{
  _id: ObjectId(&quot;&quot;),
  items: [
   {value: &quot;abc&quot;, other: &quot;other1&quot;},
   {value: &quot;def&quot;, other: &quot;other2&quot;}
  ],
  other: &quot;other&quot;
}
</code></pre>
<p>I want to transform all the documents in this collection into the following shape:</p>
<pre><code>{
  _id: ObjectId(&quot;&quot;),
  items: [
   {values: [&quot;abc&quot;], value: &quot;abc&quot;, other: &quot;other1&quot;},
   {values: [&quot;def&quot;], value: &quot;def&quot;, other: &quot;other2&quot;}
  ],
  other: &quot;other&quot;
}
</code></pre>
<p>where every subdocument in <code>items</code> now has an extra array field <code>values</code> which only holds the <code>value</code> field value.</p>
<p>How can I achieve this transformation in an efficient way?</p>
<p>I tried the following query:</p>
<pre><code>db.collection.find({}).forEach(function (doc) {
  doc.items.forEach(function (item) {
    item.values = [item.value];
  });
  db.collection.save(doc);
});
</code></pre>
<p>But it took quite a long time (the collection has 1.5M documents), so I'd like to know more efficient way (possibly using aggregation operations?).</p>

